export default function Labs() {
  return (
    <div>
      <TOC />
      <h1>Welcome to Web Dev!!</h1>
      <h1>Labs</h1>
      <Routes>
        <Route path="/" element={<Navigate to="Lab1" />} />
        <Route path="/Lab1" element={<Lab1 />} />
        <Route path="/Lab2" element={<Lab2 />} />
      </Routes>
      {/* <Lab1 />
      <Lab2 />
